import { Link,useNavigate } from "react-router-dom";
import { Container, Row, Col } from "react-bootstrap";
import Classess from "../../css/index.module.css";
export default  AdminHeader = () => {
     const navigate = useNavigate();
  return (
    <Container fluid className="bg-dark py-2 ">
      <Row>
        <Col
          onClick={() => navigate(-1)}
          className={`${Classess.link} ${Classess.hover} text-end  py-1 rounded-pill border border-warning`}
        >
          GO BACK
        </Col>
        <Col>
          <Link
            className={`${Classess.link} ${Classess.hover} mx-5 px-4 py-1 rounded-pill border border-warning`}
            to="book"
          >
            book
          </Link>
        </Col>
        <Col>
          <Link
            className={` ${Classess.link} ${Classess.hover} mx-5 px-4 py-1 rounded-pill border border-warning`}
            to="quran"
          >
            quran
          </Link>
        </Col>
        <Col>
          <Link
            className={`${Classess.link} ${Classess.hover} mx-5 px-4 py-1 rounded-pill border border-warning`}
            to="subject"
          >
            subject
          </Link>
        </Col>
        <Col
          onClick={() => navigate(1)}
          className={`${Classess.link} ${Classess.hover} text-start px-4 py-1 rounded-pill border border-warning`}
        >
          GO FORWARD
        </Col>
      </Row>
    </Container>
  );
};
